import React from "react";
import { TextField } from "@material-ui/core";

const HomePage = () => {
	return (
		<>
			<h1>Home Page</h1>
			<form>
				<TextField placeholder="Search recipes" variant="outlined" />
			</form>
		</>
	);
};

export default HomePage;
